      out.write("    $(document).ready(function(){\r\n");
      out.write("        // 저장된 쿠키값을 가져와서 ID 칸에 넣어준다. 없으면 공백으로 들어감.\r\n");
      out.write("        var key = getCookie(\"key\");\r\n");
