      out.write("            if($(\"#savId\").is(\":checked\")){ // ID 저장하기 체크했을 때,\r\n");
      out.write("                setCookie(\"key\", $(\"#userId\").val(), 30); // 7일 동안 쿠키 보관\r\n");
      out.write("            }else{ // ID 저장하기 체크 해제 시,\r\n");
