      out.write("        });\r\n");
      out.write("         \r\n");
      out.write("        // ID 저장하기를 체크한 상태에서 ID를 입력하는 경우, 이럴 때도 쿠키 저장.\r\n");
      out.write("        $(\"#userId\").keyup(function(){ // ID 입력 칸에 ID를 입력할 때,\r\n");
